SECTION 2257 COMPLIANCE MADE EASY! 

This productivity app is designed to allow producers of certain erotic-themed images or video to easily compile, store, and transmit model age and information records required by U.S. law. Performers, photographers, website operators and others involved in the production of such material must generate legal records containing specific categories of information under Title 18 U.S.C. §§ 2257 & 2257A (“Section 2257”). A copy of the performer’s picture ID card must also be included in the records. Some online platforms also require a written record of consent by the performer to be depicted on a specific website or account.

Quick 2257® allows you to:

• Create a form containing the performer’s legal name, stage names, and/or aliases;
• Record the date of original production of the depiction;
• Identify the title of the work associated with the depiction;
• Capture the performer’s picture ID card and verification photo on the mobile device; 
• Sign and verify the accuracy of the information using the touch screen;

• Create a written, signed consent form authorizing publication of the depiction;

• Compile all information into convenient .pdf forms; and,
• Store the records on the device or email them to the records custodian.

Developed by Lawrence G. Walters, Esq., First Amendment attorney and inventor of other technology designed for the online entertainment industry, this app streamlines the process of generating and transmitting Section 2257 records and consent forms. Anyone involved in the production of erotic material can now quickly compile, store, and transmit the mandatory performer records using this simple mobile app.

